import React from 'react'
import { Box, Grid, Typography, makeStyles } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
    root: { height: "100vh", width: "100vw" },
    loginFormContainer: { margin: "0 auto", border: "1px solid red" }
}))

const Login = () => {
    const classes = useStyles();
    return (
        <>
            <Box className={classes.root} py={10}>
                <Grid container>
                    <Grid item lg={4} md={8} xs={10} className={classes.loginFormContainer} >
                        <Box>
                            <Box>
                                <Typography variant="h4" align="center">Google</Typography>
                                <Typography variant="h4" align="center">Google</Typography>
                                <Typography variant="h4" align="center">Google</Typography>

                            </Box>
                            <Box></Box>
                        </Box>
                    </Grid>
                </Grid>
            </Box>
        </>
    )
}

export default Login
